import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the first "Add to Cart" button
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    const firstAddToCartButton = await page.$('.add-to-cart:first-of-type');
    await firstAddToCartButton.scrollIntoViewIfNeeded();
    await firstAddToCartButton.click();

    // Wait for cart update and take screenshot
    await page.waitForTimeout(1000); // Brief pause for UI update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_to_cart.png'));

    // Extract product title and verify cart update
    const productTitle = await page.$eval('.product-title:first-of-type', el => el.textContent.trim());
    const cartText = await page.$eval('.cart', el => el.textContent.trim());

    return {
      success: true,
      action: "Added first product to cart",
      extractedData: {
        productTitle,
        cartStatus: cartText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
